import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import Home from "./pages/Home";

function App() {
  return (
    <Routes>
      <Route exact path="/">
        <Home />
      </Route>
    </Routes>
  );
}

export default App;
